import React from "react";
import Button from '@material-ui/core/Button';

const Submit = ({ navigation }) => {
  const { go } = navigation;
  return (
    <div>
      <h3>Thank you for submitting. We will be in touch</h3>
      <Button onClick={() => go("names")}>New</Button>
    </div>
  );
};

export default Submit;
